import { Component } from 'react';
import './App.css';
import ancora from ".src/components/ancora";
import formulario from '.src/components/ancora/formulario';


class envio extends Component {
  render() {
    return (
      <Fragment className='ancora'>
        <ancora/>
        <formulario />
      </Fragment>
    );
  }
}
export default envio;
